    }
  }, [dispatch, user]);
  let router;
  if (user && user.role === "admin") {
    router = adminRouter;
  } else {
    router = userRoutes;
  }
  return (
    checkAuth && (
      <>
        <Suspense fallback={<Loader />}>
          <RouterProvider router={router} />
          <ToastContainer />
        </Suspense>
      </>
    )
  );
}

export default App;
